CustomCSS:
:root {
  --better-pale: #d3dbe9 !important;
  --text-color: #56535f !important;
  --background-primary: #ffffff !important;
  --background-secondary: #e5e7eb !important;
  --theme-primary: #ffffff !important;
  --theme-secondary: #e5e7eb !important;
  --text-primary: black !important;
}

.dark {
  --better-pale: color-mix(in srgb, #1e2430 95%, white 5%) !important;
  --text-color: #e5e7eb !important;
  --background-primary: #1e2430 !important;
  --background-secondary: #161c25 !important;
  --theme-primary: #1e2430 !important;
  --theme-secondary: #161c25 !important;
  --text-primary: #e5e7eb !important;
}

:root, html, body, div, ol, ul {
  scrollbar-color: rgba(0, 0, 0, 0.2) transparent !important;
}

:root::-webkit-scrollbar-thumb {
  background: rgba(0, 0, 0, 0.2) !important;
  border-radius: 8px !important;
}

#container {
  background: #E4EBF5 !important;
}

#title {
  padding-left: 280px;
}

.dark #container {
  background: #1e2430 !important;
  color: #e5e7eb;
}

#background {
  opacity: 0.1;
}

.menuShown #container #content h1#title, #container #content h1#title {
  box-shadow: none !important;
  background: transparent;
  border-bottom: none !important;
}

.menuShown #container #content h1#title::before, #container #content h1#title::before {
  display: none;
}

#main {
  border-top-left-radius: 2rem;
  box-shadow: -10px -10px 30px #FFF, 10px 10px 30px rgba(200, 208, 231, 0.25);
}

.dark #main {
  box-shadow: -10px -10px 30px #161c25, 10px 10px 30px rgba(42, 53, 69, 0.25);
}

@media (min-width: 900px) {
  #content {
    left: 280px;
  }
}

#content #toolbar {
  overflow: visible !important;
}

[class*=ReadingPane__ReadingPane___] > div {
  background: white !important;
  box-shadow: -10px -10px 30px #FFF, 10px 10px 30px rgba(200, 208, 231, 0.25);
}

.dark [class*=ReadingPane__ReadingPane___] > div {
  background: color-mix(in srgb, #1e2430 95%, white 5%) !important;
  box-shadow: -10px -10px 30px #161c25, 10px 10px 30px rgba(42, 53, 69, 0.25);
}

.home-container .border {
  background: color-mix(in srgb, #E4EBF5 98%, black 2%);
  box-shadow: -5px -5px 15px #FFF, 5px 5px 15px rgba(200, 208, 231, 0.25);
}

.dark .home-container .border {
  background: color-mix(in srgb, #1e2430 95%, white 5%);
  box-shadow: -5px -5px 15px #161c25, 5px 5px 15px rgba(42, 53, 69, 0.25);
}

.messages [class*=Viewer__sidebar___] header button {
  transition: all 300ms;
  transition-timing-function: ease-in-out;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0), inset 10px 10px 10px rgba(255, 255, 255, 0), -10px -10px 30px rgba(255, 255, 255, 0), 5px 5px 10px rgba(129, 141, 160, 0);
  box-shadow: inset -5px -5px 5px rgba(200, 208, 231, 0.15), inset 5px 5px 5px #FFF, -5px -5px 15px #FFF, 2.5px 2.5px 5px rgba(129, 141, 160, 0.3) !important;
  border-radius: 16px !important;
}

.dark .messages [class*=Viewer__sidebar___] header button {
  box-shadow: inset -5px -5px 5px rgba(22, 28, 37, 0.5), inset 5px 5px 5px #2a3545, -5px -5px 15px #161c25, 2.5px 2.5px 5px rgba(0, 0, 0, 0.3) !important;
}

.messages [class*=Viewer__sidebar___] header button:hover {
  box-shadow: inset -5px -5px 5px rgba(200, 208, 231, 0.15), inset 5px 5px 5px #FFF, -5px -5px 15px #FFF, 2.5px 2.5px 5px rgba(129, 141, 160, 0.3) !important;
  transform: scale(1.01);
}

.dark .messages [class*=Viewer__sidebar___] header button:hover {
  box-shadow: inset -5px -5px 5px rgba(22, 28, 37, 0.5), inset 5px 5px 5px #2a3545, -5px -5px 15px #161c25, 2.5px 2.5px 5px rgba(0, 0, 0, 0.3) !important;
}

.messages [class*=Viewer__sidebar___] header button:active {
  box-shadow: inset 5px 5px 5px rgba(200, 208, 231, 0.15), inset -5px -5px 5px #FFF, inset 0.1rem 0.1rem 0.25rem rgba(129, 141, 160, 0.3), inset -0.1rem -0.1rem 0.25rem #FFF !important;
  transform: scale(0.98);
}

.dark .messages [class*=Viewer__sidebar___] header button:active {
  box-shadow: inset 5px 5px 5px rgba(22, 28, 37, 0.5), inset -5px -5px 5px #2a3545, inset 0.1rem 0.1rem 0.25rem rgba(0, 0, 0, 0.3), inset -0.1rem -0.1rem 0.25rem #2a3545 !important;
}

.messages [class*=Viewer__sidebar___] header button::after {
  background: color-mix(in srgb, #E4EBF5 85%, black 50%) !important;
}

.dark .messages [class*=Viewer__sidebar___] header button::after {
  background: color-mix(in srgb, #1e2430 85%, black 50%) !important;
}

[class*=LabelList__LabelList___] {
  padding: 0 8px !important;
  display: flex;
  flex-direction: column;
  gap: 4px;
  overflow: visible;
}

@media (max-width: 1200px) {
  [class*=LabelList__LabelList___] {
    flex-direction: row;
  }
}

[class*=LabelList__LabelList___] > li {
  margin: 0 !important;
  border-radius: 8px;
  transition: all 300ms;
  transition-timing-function: ease-in-out;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0), inset 10px 10px 10px rgba(255, 255, 255, 0), -10px -10px 30px rgba(255, 255, 255, 0), 5px 5px 10px rgba(129, 141, 160, 0);
}

.dark [class*=LabelList__LabelList___] > li {
  color: #e5e7eb;
}

[class*=LabelList__LabelList___] > li[class*=LabelList__selected___], [class*=LabelList__LabelList___] > li:hover {
  background: rgba(255, 255, 255, 0.44);
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0.15), inset 10px 10px 10px #FFF, -10px -10px 30px #FFF, 5px 5px 10px rgba(129, 141, 160, 0.3) !important;
}

.dark [class*=LabelList__LabelList___] > li[class*=LabelList__selected___], .dark [class*=LabelList__LabelList___] > li:hover {
  background: color-mix(in srgb, #1e2430 95%, white 5%);
  box-shadow: inset -10px -10px 10px rgba(22, 28, 37, 0.5), inset 10px 10px 10px #2a3545, -10px -10px 30px #161c25, 5px 5px 10px rgba(0, 0, 0, 0.3) !important;
}

[class*=LabelList__LabelList___] > li:active {
  box-shadow: inset 10px 10px 10px rgba(200, 208, 231, 0.15), inset -10px -10px 10px #FFF, inset 0.2rem 0.2rem 0.5rem rgba(129, 141, 160, 0.3), inset -0.2rem -0.2rem 0.5rem #FFF !important;
}

.dark [class*=LabelList__LabelList___] > li:active {
  box-shadow: inset 10px 10px 10px rgba(22, 28, 37, 0.5), inset -10px -10px 10px #2a3545, inset 0.2rem 0.2rem 0.5rem rgba(0, 0, 0, 0.3), inset -0.2rem -0.2rem 0.5rem #2a3545 !important;
}

#shortcuts > a {
  transition: all 300ms;
  transition-timing-function: ease-in-out;
  background: #E4EBF5 !important;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0.15), inset 10px 10px 10px #FFF, -10px -10px 30px #FFF, 5px 5px 10px rgba(129, 141, 160, 0.3) !important;
}

.dark #shortcuts > a {
  background: #1e2430 !important;
  box-shadow: inset -10px -10px 10px rgba(22, 28, 37, 0.5), inset 10px 10px 10px #2a3545, -10px -10px 30px #161c25, 5px 5px 10px rgba(0, 0, 0, 0.3) !important;
  color: #e5e7eb;
}

#shortcuts > a .shortcut {
  background: transparent;
}

#shortcuts > a:hover {
  transform: scale(1.05);
}

#shortcuts > a:active {
  transform: scale(0.95);
  box-shadow: inset 10px 10px 10px rgba(200, 208, 231, 0.15), inset -10px -10px 10px #FFF, inset 0.2rem 0.2rem 0.5rem rgba(129, 141, 160, 0.3), inset -0.2rem -0.2rem 0.5rem #FFF !important;
}

.dark #shortcuts > a:active {
  box-shadow: inset 10px 10px 10px rgba(22, 28, 37, 0.5), inset -10px -10px 10px #2a3545, inset 0.2rem 0.2rem 0.5rem rgba(0, 0, 0, 0.3), inset -0.2rem -0.2rem 0.5rem #2a3545 !important;
}

.day:hover {
  background: transparent;
}

#menu {
  background: transparent !important;
  width: 280px;
}

#menu > ul li {
  width: calc(85% - 10px) !important;
  margin-right: 16px !important;
}

#menu > ul::before {
  box-shadow: none !important;
  border-bottom: none !important;
  position: unset !important;
}

@media (max-width: 900px) {
  #menu > ul::before {
    background-color: transparent !important;
  }
}

#menu li {
  transition: all 300ms;
  transition-timing-function: ease-in-out;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0), inset 10px 10px 10px rgba(255, 255, 255, 0), -10px -10px 30px rgba(255, 255, 255, 0), 5px 5px 10px rgba(129, 141, 160, 0);
}

.dark #menu li {
  color: #e5e7eb;
}

#menu li:hover {
  background: #E4EBF5;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0.15), inset 10px 10px 10px #FFF, -10px -10px 30px #FFF, 5px 5px 10px rgba(129, 141, 160, 0.3) !important;
}

.dark #menu li:hover {
  background: #1e2430;
  box-shadow: inset -10px -10px 10px rgba(22, 28, 37, 0.5), inset 10px 10px 10px #2a3545, -10px -10px 30px #161c25, 5px 5px 10px rgba(0, 0, 0, 0.3) !important;
}

#menu li:active {
  box-shadow: inset 10px 10px 10px rgba(200, 208, 231, 0.15), inset -10px -10px 10px #FFF, inset 0.2rem 0.2rem 0.5rem rgba(129, 141, 160, 0.3), inset -0.2rem -0.2rem 0.5rem #FFF !important;
}

.dark #menu li:active {
  box-shadow: inset 10px 10px 10px rgba(22, 28, 37, 0.5), inset -10px -10px 10px #2a3545, inset 0.2rem 0.2rem 0.5rem rgba(0, 0, 0, 0.3), inset -0.2rem -0.2rem 0.5rem #2a3545 !important;
}

#menu li.active > .sub > ul > .active, #menu li.active {
  background: #E4EBF5 !important;
  color: #2f2e33 !important;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0.15), inset 10px 10px 10px #FFF, -10px -10px 30px #FFF, 5px 5px 10px rgba(129, 141, 160, 0.3) !important;
}

.dark #menu li.active > .sub > ul > .active, .dark #menu li.active {
  background: #1e2430 !important;
  color: #e5e7eb !important;
  box-shadow: inset -10px -10px 10px rgba(22, 28, 37, 0.5), inset 10px 10px 10px #2a3545, -10px -10px 30px #161c25, 5px 5px 10px rgba(0, 0, 0, 0.3) !important;
}

#menu li.active > .sub > ul > .active::before, #menu li.active::before {
  background: linear-gradient(to bottom, color-mix(in srgb, var(--item-colour) 85%, white 50%), var(--item-colour)) !important;
}

.dark #menu li.active > .sub > ul > .active::before, .dark #menu li.active::before {
  background: linear-gradient(to bottom, color-mix(in srgb, var(--item-colour) 85%, color-mix(in srgb, #1e2430 95%, white 5%) 50%), var(--item-colour)) !important;
}

[class*=MessageList__MessageList___] {
  background: transparent;
  border: unset !important;
  overflow: visible;
  width: 100px;
}

@media (max-width: 1200px) {
  [class*=MessageList__MessageList___] {
    width: 100%;
  }
}

[class*=MessageList__MessageList___] header {
  background: transparent;
  border: unset !important;
  padding: 8px 0;
}

[class*=MessageList__MessageList___] header label {
  background: #eef1f6;
  box-shadow: inset -5px -5px 5px rgba(200, 208, 231, 0.15), inset 5px 5px 5px #FFF, -5px -5px 15px #FFF, 2.5px 2.5px 5px rgba(129, 141, 160, 0.3) !important;
  border-radius: 16px;
  background: white;
}

.dark [class*=MessageList__MessageList___] header label {
  background: color-mix(in srgb, #1e2430 95%, white 5%);
  box-shadow: inset -5px -5px 5px rgba(22, 28, 37, 0.5), inset 5px 5px 5px #2a3545, -5px -5px 15px #161c25, 2.5px 2.5px 5px rgba(0, 0, 0, 0.3) !important;
}

[class*=MessageList__MessageList___] header label:has(input:focus) {
  box-shadow: inset 0.2rem 0.2rem 0.5rem rgba(129, 141, 160, 0.3), inset -0.2rem -0.2rem 0.5rem #FFF !important;
}

.dark [class*=MessageList__MessageList___] header label:has(input:focus) {
  box-shadow: inset 0.2rem 0.2rem 0.5rem rgba(0, 0, 0, 0.3), inset -0.2rem -0.2rem 0.5rem #2a3545 !important;
}

[class*=MessageList__MessageList___] header label input {
  padding: 10px 8px;
}

.dark [class*=MessageList__MessageList___] header label input {
  color: #e5e7eb;
}

[class*=MessageList__MessageList___] header label:has(input:focus) {
  box-shadow: 0.3rem 0.3rem 0.6rem rgba(129, 141, 160, 0.3), -0.2rem -0.2rem 0.5rem #FFF;
}

.dark [class*=MessageList__MessageList___] header label:has(input:focus) {
  box-shadow: 0.3rem 0.3rem 0.6rem rgba(0, 0, 0, 0.3), -0.2rem -0.2rem 0.5rem #2a3545;
}

[class*=MessageList__MessageList___] footer {
  border: unset !important;
}

[class*=MessageList__MessageList___] ol {
  background: #FFF;
  border-radius: 16px;
  box-shadow: -5px -5px 15px #FFF, 5px 5px 15px rgba(200, 208, 231, 0.25);
}

.dark [class*=MessageList__MessageList___] ol {
  background: color-mix(in srgb, #1e2430 95%, white 5%);
  box-shadow: -5px -5px 15px #161c25, 5px 5px 15px rgba(42, 53, 69, 0.25);
}

[class*=MessageList__MessageList___] ol [class*=MessageList__unread___] {
  background: #FFF;
}

.dark [class*=MessageList__MessageList___] ol [class*=MessageList__unread___] {
  background: color-mix(in srgb, #1e2430 95%, white 5%);
}

[class*=MessageList__MessageList___] ol li {
  transition: all 100ms;
  transition-timing-function: ease-in-out;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0), inset 10px 10px 10px rgba(255, 255, 255, 0), -10px -10px 30px rgba(255, 255, 255, 0), 5px 5px 10px rgba(129, 141, 160, 0);
}

.dark [class*=MessageList__MessageList___] ol li {
  color: #e5e7eb;
}

[class*=MessageList__MessageList___] ol li:hover {
  background: rgba(228, 235, 245, 0.44);
  box-shadow: inset -5px -5px 5px rgba(200, 208, 231, 0.15), inset 5px 5px 5px #FFF, -5px -5px 15px #FFF, 2.5px 2.5px 5px rgba(129, 141, 160, 0.3) !important;
}

.dark [class*=MessageList__MessageList___] ol li:hover {
  background: color-mix(in srgb, #1e2430 95%, white 5%);
  box-shadow: inset -5px -5px 5px rgba(22, 28, 37, 0.5), inset 5px 5px 5px #2a3545, -5px -5px 15px #161c25, 2.5px 2.5px 5px rgba(0, 0, 0, 0.3) !important;
}

[class*=MessageList__MessageList___] ol li:active {
  box-shadow: inset 5px 5px 5px rgba(200, 208, 231, 0.15), inset -5px -5px 5px #FFF, inset 0.1rem 0.1rem 0.25rem rgba(129, 141, 160, 0.3), inset -0.1rem -0.1rem 0.25rem #FFF !important;
}

.dark [class*=MessageList__MessageList___] ol li:active {
  box-shadow: inset 5px 5px 5px rgba(22, 28, 37, 0.5), inset -5px -5px 5px #2a3545, inset 0.1rem 0.1rem 0.25rem rgba(0, 0, 0, 0.3), inset -0.1rem -0.1rem 0.25rem #2a3545 !important;
}

[class*=MessageList__MessageList___] ol li[class*=MessageList__selected___] {
  background: rgba(200, 208, 231, 0.15) !important;
  box-shadow: inset 4px 4px 4px rgba(200, 208, 231, 0.15), inset -4px -4px 4px #FFF, inset 0.08rem 0.08rem 0.2rem rgba(129, 141, 160, 0.3), inset -0.08rem -0.08rem 0.2rem #FFF !important;
}

.dark [class*=MessageList__MessageList___] ol li[class*=MessageList__selected___] {
  background: rgba(22, 28, 37, 0.15) !important;
  box-shadow: inset 4px 4px 4px rgba(22, 28, 37, 0.5), inset -4px -4px 4px #2a3545, inset 0.08rem 0.08rem 0.2rem rgba(0, 0, 0, 0.3), inset -0.08rem -0.08rem 0.2rem #2a3545 !important;
}

.formattedText > .wrapper, .coneqtMessage.composer .prime {
  overflow-x: visible !important;
}

.cke_contents {
  box-shadow: -5px -5px 15px #FFF, 5px 5px 15px rgba(200, 208, 231, 0.25);
}

.dark .cke_contents {
  box-shadow: -5px -5px 15px #161c25, 5px 5px 15px rgba(42, 53, 69, 0.25);
  background: color-mix(in srgb, #1e2430 95%, white 5%);
}

.userInfosvgdiv {
  filter: invert(1);
}

.userInfosvgdiv .tooltiptext {
  filter: invert(0);
  box-shadow: unset !important;
}

.connectedNotificationsWrapper > div > button {
  background: var(--theme-primary) !important;
}

.connectedNotificationsWrapper > div > button svg g {
  fill: var(--text-primary) !important;
}

button.addedButton {
  background: var(--theme-primary) !important;
  color: var(--text-primary) !important;
}

button.addedButton svg {
  fill: var(--text-primary) !important;
}

[class*=Avatar__Avatar___] {
  box-shadow: 0 0 10px var(--better-main);
}

.blind:has(> input[type=checkbox]) {
  display: flex;
  place-items: center;
}

.blind:has(> input[type=checkbox]) label {
  display: block;
}

.uiFileHandlerPanel {
  background: color-mix(in srgb, #E4EBF5 35%, white 90%) !important;
  box-shadow: -10px -10px 30px #FFF, 10px 10px 30px rgba(200, 208, 231, 0.25);
}

.dark .uiFileHandlerPanel {
  background: color-mix(in srgb, #1e2430 35%, color-mix(in srgb, #1e2430 95%, white 5%) 90%) !important;
  box-shadow: -10px -10px 30px #161c25, 10px 10px 30px rgba(42, 53, 69, 0.25);
}

[class*=Container__container___], [class*=Document__document___], [class*=Module__wrapper___] {
  overflow: visible !important;
}

[class*=RootModule__root-module___] {
  overflow: visible !important;
}

[class*=RootModule__root-module___] [class*=Module__wrapper___] {
  box-shadow: -10px -10px 30px #FFF, 10px 10px 30px rgba(200, 208, 231, 0.25);
}

.dark [class*=RootModule__root-module___] [class*=Module__wrapper___] {
  box-shadow: -10px -10px 30px #161c25, 10px 10px 30px rgba(42, 53, 69, 0.25);
}

[class*=notifications__notifications___] > button, .addedButton, .uiButton:not(.logout) {
  border-radius: 16px !important;
  transition: all 300ms;
  transition-timing-function: ease-in-out;
  box-shadow: inset -5px -5px 5px rgba(200, 208, 231, 0.15), inset 5px 5px 5px #FFF, -5px -5px 15px #FFF, 2.5px 2.5px 5px rgba(129, 141, 160, 0.3) !important;
  background: rgba(255, 255, 255, 0.6) !important;
}

.dark [class*=notifications__notifications___] > button, .dark .addedButton, .dark .uiButton:not(.logout) {
  box-shadow: inset -5px -5px 5px rgba(22, 28, 37, 0.5), inset 5px 5px 5px #2a3545, -5px -5px 15px #161c25, 2.5px 2.5px 5px rgba(0, 0, 0, 0.3) !important;
  background: color-mix(in srgb, #1e2430 95%, white 5%) !important;
  color: #e5e7eb;
}

[class*=notifications__notifications___] > button:hover, .addedButton:hover, .uiButton:not(.logout):hover {
  background: rgba(255, 255, 255, 0.44) !important;
  box-shadow: inset -10px -10px 10px rgba(200, 208, 231, 0.15), inset 10px 10px 10px #FFF, -10px -10px 30px #FFF, 5px 5px 10px rgba(129, 141, 160, 0.3) !important;
}

.dark [class*=notifications__notifications___] > button:hover, .dark .addedButton:hover, .dark .uiButton:not(.logout):hover {
  background: color-mix(in srgb, #1e2430 95%, white 5%) !important;
  box-shadow: inset -10px -10px 10px rgba(22, 28, 37, 0.5), inset 10px 10px 10px #2a3545, -10px -10px 30px #161c25, 5px 5px 10px rgba(0, 0, 0, 0.3) !important;
}

[class*=notifications__notifications___] > button:active, .addedButton:active, .uiButton:not(.logout):active {
  box-shadow: inset 10px 10px 10px rgba(200, 208, 231, 0.15), inset -10px -10px 10px #FFF, inset 0.2rem 0.2rem 0.5rem rgba(129, 141, 160, 0.3), inset -0.2rem -0.2rem 0.5rem #FFF !important;
}

.dark [class*=notifications__notifications___] > button:active, .dark .addedButton:active, .dark .uiButton:not(.logout):active {
  box-shadow: inset 10px 10px 10px rgba(22, 28, 37, 0.5), inset -10px -10px 10px #2a3545, inset 0.2rem 0.2rem 0.5rem rgba(0, 0, 0, 0.3), inset -0.2rem -0.2rem 0.5rem #2a3545 !important;
}

input[type=checkbox] {
  -webkit-appearance: none;
  -moz-appearance: none;
  appearance: none;
  width: 24px;
  height: 24px;
  border-radius: 6px;
  background-color: #E4EBF5 !important;
  cursor: pointer;
  position: relative;
  margin: 0;
  box-shadow: -1.5px -1.5px 4px #FFF, 1.5px 1.5px 4px rgba(200, 208, 231, 0.25);
  transition: all 200ms;
  transition-timing-function: ease-in-out;
}

.dark input[type=checkbox] {
  background-color: #1e2430 !important;
}

.dark input[type=checkbox] {
  box-shadow: -1.5px -1.5px 4px #161c25, 1.5px 1.5px 4px rgba(42, 53, 69, 0.25);
}

input[type=checkbox]:hover {
  transform: scale(1.05);
}

input[type=checkbox]:checked {
  box-shadow: inset 1.4px 1.4px 2.1px rgba(200, 208, 231, 0.15), inset -1.4px -1.4px 2.1px #FFF, inset 0.07rem 0.07rem 0.14rem rgba(129, 141, 160, 0.3), inset -0.07rem -0.07rem 0.14rem #FFF;
  background-color: #cfd4df;
